import {request} from "@/service/utils";

export default {
    getAllUsers() {
        return request('get', '/user/all').then((response) => {
            return response;
        });
    },
    /**
     *
     * @param {Object} params
     * @param {Object} params.data
     * @param {String} params.data.content
     * @param {String} params.data.test
     * @param {Array} params.data.route
     *
     * @returns {Promise}
     */
    createDoc(params = {}) {
        return request('post', '/docs/create', params).then((response) => {
            return response
        })
    },
}
